import React, { Component } from 'react'

class TeamMember extends Component {
    render() {
        return (
            <div>
                <h1>Member1: Oscar</h1>
                <h1>Member2: Yuepeng</h1>
                <h1>Member3: Indirakshi</h1>
                <h1>Member4: Andhika</h1>
            </div>
        )
    }
}
export default TeamMember;
